Larry writes the number 3 on his pinky finger.  He then applies $f$ to 3 and writes the output on his ring finger.  If Larry continues this process of applying $f$ and writing the output on a new finger, what number will Larry write on his tenth finger?

A square is divided into nine smaller squares of equal area. The center square is then divided into nine smaller squares of equal area and the pattern continues indefinitely. What fractional part of the figure is shaded? [asy]
import olympiad; size(150); defaultpen(linewidth(0.8)); dotfactor=4;
void drawSquares(int n){

draw((n,n)--(n,-n)--(-n,-n)--(-n,n)--cycle);

fill((-n,n)--(-1/3*n,n)--(-1/3*n,1/3*n)--(-n,1/3*n)--cycle);

fill((-n,-n)--(-1/3*n,-n)--(-1/3*n,-1/3*n)--(-n,-1/3*n)--cycle);

fill((n,-n)--(1/3*n,-n)--(1/3*n,-1/3*n)--(n,-1/3*n)--cycle);

fill((n,n)--(1/3*n,n)--(1/3*n,1/3*n)--(n,1/3*n)--cycle);
}

drawSquares(81); drawSquares(27); drawSquares(9); drawSquares(3); drawSquares(1);
[/asy]

Allie and Betty play a game where they take turns rolling a standard die. If a player rolls $n$, she is awarded $f(n)$ points, where  \[f(n) = \left\{
\begin{array}{cl} 6 & \text{ if }n\text{ is a multiple of 2 and 3}, \\
2 & \text{ if }n\text{ is only a multiple of 2}, \\
0 & \text{ if }n\text{ is not a multiple of 2}.
\end{array}
\right.\]Allie rolls the die four times and gets a 5, 4, 1, and 2. Betty rolls and gets 6, 3, 3, and 2. What is the product of Allie's total points and Betty's total points?
